import Header from './Components/Header';
import Footer from "./Components/Footer";
import { Container } from "react-bootstrap";
function App() {
  return (
    <main className="App">
      <Header />
      <Container>
        <div className="div">Hello world</div>
      </Container>
      <Footer />
    </main>
  );
}

export default App;
